@Jhsmith1984 @ElPutoToro @Meeks91 I just posted this on another thread with @raveking but as much as it pains me I could also “worst case” scenario see this drifting/dropping/dipping whatever word you want to use and don’t know if it would be a quick hit or slow drip but $0.65 is a possible outcome if they retrace more than 61.8%. Here was my thoughts from that thread:

we’ve almost retraced a full 61.8% from the high of $1.44 (6/29) to low of $0.41 (6/15). The full 61.8% retrace mark is $0.7995 which is another 6% lower. That is reasonably possible. If they want to really shake the tree it could possibly dip all the way down to the $0.65 which would be the 76.4% retrace level.  I just can’t see it going lower than $.80 but I have my stop loss just below $0.65. 

Still believe we are $2+ on the collab news but damnit Isaac better deliver the goods. Bullish

